import React from 'react';
import './App.css';

import TitlePage from './objects/TitlePage';
import Form from './objects/Form';

const App = () => (
  <>
    <TitlePage title="Lorem ipsum dolor sit amet, consectetur adipisicing elit. Alias est aspernatur possimus, iure repudiandae ratione excepturi optio quidem nostrum aliquid officiis esse, delectus eum ducimus. Sed minus cupiditate dolorum commodi." />
    <Form />
  </>
);

export default App;
